import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
    <div className="contact-container">
      <h1>Contact Us</h1>
      <p>Email: support@alzheimerspredict.com</p>
      <p>Phone: +91 9876543210</p>
      <p>Address: Healthcare Center, City, Country</p>
    </div>
  );
};

export default Contact;
